import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Newsletters from "./pages/newsletter.jsx";
import Home from "./pages/home.jsx";
function App() {
  return (
<div class="relative min-h-screen inset-0 -z-10 h-full w-full items-center px-5 py-24 [background:linear-gradient(125deg,#005276,#38ef7d)]">

    {/* //</div> <div class="absolute inset-0 -z-10 h-full w-full items-center px-5 py-24 [background:radial-gradient(125%_125%_at_50%_10%,#005276_40%,#38ef7d_100%)]"> */}
 <Router>
 <Routes>
   <Route path="/" element={<Home/>} />
   <Route path="/news" element={<Newsletters />} />
 </Routes>
</Router>

</div>
  );
}

export default App;
